import React, { Component } from 'react';
import sytled from "styled-components";
import Forms from "./form.jsx";
import Background from '../images/t3.jpg'


const Container=sytled.div`
    background-image:url(${Background});
    background-size:100% 100%;
    background-attachment:fixed;
    height:100%;
    width:calc(100%/1)
    margin:0px 0px;
    z-index:1;
    position:relative;

    @media (max-width:425px){
        height:100%;
      }
      @media (min-width:768px){
        height: 100vh;
      }

`

const Container1=sytled.div`
background-color:#1716168c!important;
position:relative;
margin-top:0%;
left:0%;
top:-0px;
padding-bottom:5%;
width:100%;
height:100%;

@media (max-width:425px){
  height:100%;
}


`
const Textcontainer=sytled.div`
    background-color:var(--transparent);
    height:100%;
    width:60%;
    margin:0px 0px;
    @media(max-width:425px){
        width:100%; 
    }
    @media(min-width:425px) and  (orientation: landscape){
        width:100%; 
    }
`

const Text=sytled.p`
    width:60%; 
    color:white;
    margin:0 auto;
    padding:50px 0px;
@media(max-width:425px){
    width:100%; 
}
@media(min-width:425px) and  (orientation: landscape){
    width:100%; 
}
@media(min-width:768px) {
    align-self: center;

}
`
const Box=sytled.span`
    text-align:center;
   color:var(--secondary-color);
`

const Headingcontainer=sytled.div`
    text-align:center;

`
const Heading=sytled.h2`
    text-align:center;
    color:white;
    margin:0px;
`


const ContainerInner=sytled.div`
    display:flex;
    padding: 0px 5% 0% 5%;

@media(max-width:768px){
    display:flex;
    flex-direction:column;
}
@media(min-width:769px){

   display:flex;
   flex-direction:row;
}
`

const FormContainer=sytled.div`
    width:Calc(100%/2);
    padding:0px 5% 0px 0% ;
@media(max-width:768px){
    width:Calc(100%/1);
    padding:0px;
}
@media(min-width:1025px){
    width:Calc(100%/3);
}
`


class ContactMe extends Component {

render() { 
    return (

           <Container id="ContactMe" className="overlay">
               <Container1 >
               <Headingcontainer ><Heading className="headings ">Get In Touch</Heading></Headingcontainer>

               <ContainerInner>

                   <Textcontainer>



                <Text >
                Let’s meet for your free consultation, whether on Skype or in person at your favourite coffee spot. <br/> Bring along your thoughts, ideas and wishes as I would love to find out about you! Only Cape Town clients will be met in person. <br/><br/>
Please reach out to me by completing the below form, <br/> I will get back to your soonest. 

               </Text>

               <Text >
               Get in touch with me <br/>
               <br/>
<Box> Email icon :</Box> Hello@kkwe.co.za <br/>
<Box>Telephone icon :</Box> 084 716 2672 
               </Text>



               </Textcontainer>
               <FormContainer >
                    <Forms/>
               </FormContainer>


               </ContainerInner>
               </Container1>
           </Container>

         );
    }
}

export default ContactMe;
